export default function Element({rank, icon, name, symbol, priceUsd}){
    return(
        <tr className="each">
            <td className="rank">{rank}</td>
            <td>{icon}</td>
            <td>{name}/{symbol}</td>
            <td>U${priceUsd}</td>
        </tr>
    )
}
